const initialStore = {
    email : "",
    mobile : ""
}

const settingsReducer = (state = initialStore,action) => {
    
    if(action.type === "contact-info"){
        return {
            ...state,
            email : action.payload.email,
            mobile : action.payload.mobile
        }
    }
  
 
    return state;
}

export default settingsReducer;
